import React from 'react'
import ATM_Card from './Card_assets/ATM_card.png'

const Acard =({codes}) =>{
        return(
          <div class='p-4'>
          <img src={ATM_Card} alt="ATM Card"></img>
          <p class='text-xs mt-6 mr-10 inline'>{codes.text}</p>
          <span class=' text-xs'>{codes.num}</span>
          <div class='w-full h-2 bg-sky-50 rounded-lg'><div class='bg-[#4491F6] w-3/12 h-2 ounded-lg'></div> </div>
          {/* <progress value={0.2} class='w-100 bg-sky-50' /> */}
          </div>
        )
      
}

export default Acard
